import React from 'react';
import Header from './Header';
import Footer from './Footer';
import CreateNote from './CreateNote';
import Note from './Note'
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
const App = () => {
  return (
    <>
      <Header/>
      <Footer/>
      <CreateNote/>
      <Note/>
    </>
  );
}


export default App;
